import React from 'react';
import './App.sass';
import Desktop from './Desktop';
import Taskbar from './Taskbar';

function App() {
  return (
    <div className="app">
      <div></div>
      <Desktop />
      <Taskbar />
    </div>
  );
}

export default App;
